import React from 'react';
import '../css/table.css';

const MandalArtTable = ({value, onChange}) => {
    return (

        <table>
            <tr>
                <td><input value={value} onChange={onChange}/></td>
                <td><input value={value} onChange={onChange}/></td>
                <td><input value={value} onChange={onChange}/></td>
            </tr>
            <tr>
                <td><input value={value} onChange={onChange}/></td>
                <td><input value={value} onChange={onChange}/></td>
                <td><input value={value} onChange={onChange}/></td>
            </tr>
            <tr>
                <td><input value={value} onChange={onChange}/></td>
                <td><input value={value} onChange={onChange}/></td>
                <td><input value={value} onChange={onChange}/></td>
            </tr>
        </table>

    );
};

export default MandalArtTable;
